import logo from './logo.svg';
import './App.css';
import { useState } from 'react';
const List =["home",];
function App() {

  const [val,setval]=useState('');
  const ChangeHandler=(e)=>{
   List.push(val)
  }
  return (
    <>
        <input type="text" onchange={(e)=>
            setval(e.target.value)
        }></input>
        <button onClick={ChangeHandler}>Go</button>
        {List.map((hh)=>(
          <h1>{hh}</h1>
        ))}
        </>
  );
}

export default App;
